import AppStore from "./common/AppStore";
import RouteStore from "./common/RouteStore";
import PageStore from "./common/PageStore";
import MyStore from "./my/MyStore";

const Stores = {
  AppStore,
  RouteStore,
  PageStore,
  MyStore,
};

export default Stores;
